import React from "react"

const Home = () => {
    return (
    <div class='Home-wrapper'>
        <div class='Home-header'>
            <h1>HOME PAGE</h1>
        </div>
        <div class='Home-body'>
            <p>What content do we want on this page?</p>
        </div>
    </div>
    )
}

export default Home;
